    false,nt"url": null,nt"notes": "This document covers the history, location,
    climate, geology, resources, management, development, and socio-economic considerations
    of Kenai National Wildlife Refuge.  The Wilderness Act directs that all roadless
    islands and areas of 5,000 acres or more within National Wildlife Refuge shall be
    considered for inclusion as units within the National Wilderness Preservation System.
     The objective of this study is to evaluate the suitability or nonsuitability of
    the Kenai National Moose Range for consideration as wilderness.  The following units
    are considered suitable for inclusion into the National Wilderness System: The Andy
    Simons Unit, Swan Lake Goose Unit, Swanson River Canoe Unit, Caribou Hills Unit,
    Mystery Creek Basin Unit, and Elephant Lake Unit.  Thus, approximately 1,040,000
    acres of the Range is considered suitable for wilderness.",nt"license_title":
